import LegendItem from "./LegendItem";

const legendItems = [
  new LegendItem(">6", "#d17c00", (cases) => cases > 6), // #d17c0
  new LegendItem("6", "#b97500", (cases) => cases === 6),
  new LegendItem("5", "#e79200", (cases) => cases === 5),
  new LegendItem("4", "#ffa917", (cases) => cases === 4),
  new LegendItem("3", "#feba45", (cases) => cases === 3),
  new LegendItem("2", "#ffcb73", (cases) => cases === 2), // #ef9400
  new LegendItem("1", "#ffdca2", (cases) => cases === 1), // #feb423
  new LegendItem("No mentions", "#ffedd0", (cases) => cases === 0), // "#ffda51"
  // new LegendItem("No data", "#ffffff", (cases) => true),
];

export default legendItems;
